import React from "react";

const StockInfo = ({close, open, high, low, volume}) => {
    return ( 
        <div style = {{
            marginLeft: '1%'
        }}>
            <h3>Open: <p> {open}</p> </h3>
            <h3>Close: </h3> <p>  {close}</p>
            <h3>High: </h3> <p>  {high}</p>
            <h3>Low: </h3> <p>  {low}</p>
            <h3>Volume: </h3> <p> {volume}</p>
        </div> 
    );
};

export default StockInfo;
